import { Avatar, ListItem, ListItemAvatar } from '@mui/material'
import React from 'react'

export default function ChatMessage() {
  return (
    <ListItem>
      <ListItemAvatar sx={{ alignSelf: 'stretch' }}>
        <Avatar variant="rounded" sx={{ width: 50, height: 50 }} />
      </ListItemAvatar>
    </ListItem>
  )
}
